using System;
using System.Collections.Generic;
using System.Linq;

namespace NbsCodeChallenges.AdventOfCode2021
{
    public class Day_09
    {
		private static  Position[,] _heightMap;

        public static void Run()
        {
			// Setup
			var input = Day9Input.Test;
			
			_heightMap = CreateHeightMap(input);
			AddNeighbours(_heightMap.ToCollection());
			
			var depressions = _heightMap.ToCollection()
				.Where(p => p.Neighbours.All(n => n.Value > p.Value));

			// Part 1
			var part1Solution = depressions.Sum(p => p.Value + 1);

            Console.WriteLine($"Part 1: { part1Solution }");

			// Part 2
			var part2Solution = depressions
				.Select(lowPoint => GetBasin(lowPoint))
				.Select(basin => basin.Count())
				.OrderByDescending(count => count)
				.Take(3)
				.Aggregate((product, count) => product * count);

            Console.WriteLine($"Part 2: { part2Solution }");
		}

        private static Position[,] CreateHeightMap(int[,] input)
        {
			var heightMap = new Position[input.GetLength(0), input.GetLength(1)];

			for (var row = 0; row < input.GetLength(0); row++)
			{
				for (var cell = 0; cell < input.GetLength(1); cell++)
				{
					heightMap[row, cell] = new Position(input[row, cell], row, cell);

				}
			}

			return heightMap;
		}

		private static void AddNeighbours(IEnumerable<Position> positions)
        {
			foreach (var position in positions)
			{
				position.Neighbours = GetNeighbours(position);
			}
		}

		private static IEnumerable<Position> GetNeighbours(Position position)
		{
			var neighbours = new List<Position>();

			var northRow = position.Row - 1;
			var southRow = position.Row + 1;
			var eastColumn = position.Column + 1;
			var westColumn = position.Column - 1;

			if (northRow >= 0)
			{
				neighbours.Add(_heightMap[northRow, position.Column]);
			}

			if (southRow < _heightMap.GetLength(0))
			{
				neighbours.Add(_heightMap[southRow, position.Column]);
			}

			if (eastColumn < _heightMap.GetLength(1))
			{
				neighbours.Add(_heightMap[position.Row, eastColumn]);
			}

			if (westColumn >= 0)
			{
				neighbours.Add(_heightMap[position.Row, westColumn]);
			}

			return neighbours;
		}

		private static IEnumerable<Position> GetBasin(Position position)
		{
			return position.Neighbours
				.Where(n => n.Value > position.Value && n.Value < 9)
				.SelectMany(n => GetBasin(n))
				.Concat(position)
				.Distinct();
		}
    }

	public class Position
    {
        public Position(int value, int row, int column)
        {
			Value = value;
			Row = row;
			Column = column;
        }

        public int Value { get; set; }
        public int Row { get; set; }
        public int Column { get; set; }
        public IEnumerable<Position> Neighbours { get; set; }

        public override string ToString()
        {
			var neighbours = string.Join(", ", Neighbours.Select(n => n.Value));
			return $"Value: {Value}, Position: {Row}-{Column}, Neighbours: {neighbours}";
        }
    }

